        super(props)
    }
    
    render() {

        let thirdBanner = <img src={banner3} alt='banner3' className='bkgrnd'/>
        let memberships =  
        <div className="banners" id="memberships"> 
          {thirdBanner}
        </div>

    return (
        <div className="banners" id="memberships"> 
          {thirdBanner}
        </div>
      );

    }

}
export default Memberships;
